CREATE DEFINER=`wom`@`localhost` PROCEDURE `sp_trans_spend_data`(IN s_account VARCHAR(3), IN s_user VARCHAR(50))
BEGIN
	DECLARE done INT DEFAULT FALSE;
    DECLARE t_id INT;
	DECLARE t_date DATE;
    DECLARE t_amount DECIMAL(13,2);
    DECLARE t_code VARCHAR(3);
    DECLARE t_desc VARCHAR(80);
    DECLARE s_status INT DEFAULT 0;
    
    DECLARE tmp_cur CURSOR FOR 
		SELECT id, trans_date, trans_amount, trans_code, trans_desc 
        FROM wtransaction
        WHERE trans_status = 1;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
    OPEN tmp_cur;
    
    read_loop: LOOP
		FETCH tmp_cur INTO t_id, t_date, t_amount, t_code, t_desc;
        IF done THEN LEAVE read_loop;
        END IF;
        
        IF (SUBSTR(t_code,1,1) = 'G' )THEN SET s_status = 9;
        ELSE SET s_status = 0;
        END IF;
        
        INSERT INTO wspending 
		(spend_date,spend_amount,spend_account,spend_category,spend_description,spend_user, spend_status)
		VALUES
        (t_date,t_amount,s_account,t_code,t_desc, s_user, s_status);
        
        UPDATE wtransaction 
        SET trans_status = 2,
            trans_user = s_user
        WHERE id = t_id;
        
	END LOOP;
    
    CLOSE tmp_cur;
    
END ;;
